import React from 'react';
import Navbar from './navbar.js';

function Dashboard() {
  return (
    <div className="h-screen flex justify-center items-center">
      <Navbar />
      <div className="w-5/6 h-5/6 bg-darkgrey rounded-xl shadow-xl p-8 flex flex-col justify-end items-center">
  <div className="w-96 h-72 relative flex justify-between items-end">
    <div className="w-60 h-52 absolute bg-zinc-300 rounded-2xl shadow" style={{ left: '29px', top: '39px' }}></div>
    <div className="w-60 h-52 absolute bg-zinc-300 rounded-2xl shadow" style={{ left: '370px', top: '39px' }}></div>
    <div className="w-60 h-52 absolute bg-zinc-300 rounded-2xl shadow" style={{ left: '711px', top: '39px' }}></div>
    <div className="w-40 h-11 absolute text-black text-2xl font-normal font-['Abel'] tracking-tight" style={{ left: '64px', top: '59px' }}>TOTAL COMMENTS</div>
  </div>
</div>
</div>
  );
}

export default Dashboard;
